import { UPDATE_SEARCH_RESULT } from './actions';

export default (
      state = initialState,
      action,
  ) => {
      switch (action.type) {
          case UPDATE_SEARCH_RESULT:
              return {
                  ...state,
                  searchResult: action.data,
              };
          default:
              return state;
      }
  };
